import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Intro from "./components/Intro";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/intro">
            <Intro />
          </Route>
          <Route path="/rules">
            <Users />
          </Route>
          <Route path="/game">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
